house_rules:
8.6. Особые условия  (для предотвращения пожароопасных ситуаций):

- на земельном участке и прилегающей территории запрещается использовать петарды, фейерверки;
- для розжига мангала использовать исключительно угли (дрова использовать категорически запрещается);
- в жилом доме запрещается пользоваться открытым огнем (свечи, фейерверки, «бенгальские огни» и пр.);
- запрещается накрывать включенные осветительные приборы предметами из горючих материалов;
- запрещается приносить с собой взрывоопасные и легковоспламеняющиеся предметы;
- курить разрешается в специально отведенных для этого местах.

description:
гостиница «Теплый Очаг» находится в Промышленном районе Самары, на пересечении проспекта Кирова и улицы Нагорной. В непосредственной близости от гостиницы находятся шоколадная фабрика «Россия», автоцентры «Toyota», ТРЦ"Вива-Лэнд"

Заезд 12:00  Выезд 10:00
В гостинице разместились 16 номеров таких категорий комфортности, как «Люкс», «Полулюкс», «Стандарт трехместный», «Стандарт двухместный», «Стандарт одноместный». Вне зависимости от того, к какой категории относится тот или иной номер, во всех номерах имеется мебель, соответствующая классу гостиницы, включая двуспальные кровати, шкафы для хранения багажа и одежды, прикроватные тумбочки и журнальные столики. В «Полулюксе» и «Люксе» есть диваны.

Все номера оборудованы кабельным телевидением,  наборами посуды, электрическим чайником, а также чаем и кофе. Ванные комнаты оборудованы душевыми кабинами, также там имеются гигиенические принадлежности,полотенца,тапочки.

«Теплый Очаг» — единственная гостиница в Самаре, качественно предоставляющая свои услуги по небольшой стоимости и с большим спектром бесплатных услуг.
Бесплатно:
бронирование номеров;
питание — завтрак;
регистрация иностранных граждан;
трансфер с ж/д и аэровокзала;
полный пакет документов (чек, счет-фактура, счет, акт об оказании услуг);
wi-fi Интернет.

Круглосуточная работа администратора. 
Бесплатная встреча гостя из аэропорта или ж/д вокзала.

На перекрестке улицы Нагорной и проспекта Кирова, в Промышленном районе города Самары в 2005 году появилась новая гостиница эконом-класса. В 2009 году состоялась последняя реконструкция отеля. Рядом с гостиницей располагаются корпуса знаменитой на всю страну шоколадной фабрики «Россия», салоны признанных во всем мире автомобильных гигантов, таких как «Киа Моторс», «Тойота», «Лада-Самара», «Мерседес-Авто», «Хендай». Кроме того, недалеко от гостиницы находятся крупные торгово-развлекательные центры, а именно «Московский», «Империя», «Парк-Хаус», а также аквапарк.

Из любой точки города в отель можно добраться городским общественным транспортом. Из культурных и исторических достопримечательностей рядом с гостиницей располагаются Дом культуры им. Кирова и православная церковь.

Удобная транспортная развязка. 
Остановка маршрутного такси, автобуса и троллейбуса   "Черемшанская" или "Ставропольская"
Остановка трамвая "Ставропольская"

высокий уровень сервиса по умеренной стоимости;
комфортабельные номера различных классов (от одноместных до трехместных), а также двухкомнатные номера, полу-люкс и люкс. Таким образом, вы сможете подобрать номер, подходящий именно вам;
вежливый и ответственный персонал, который со знанием дела и положенным профессионализмом подходит к выполнению своих обязанностей и заботится о наших клиентах;
доверие клиентов: более семидесяти постояльцев стали нашими постоянными клиентами;

notes:
